import React,{useState,useEffect} from 'react'
import { Alert } from 'react-native'
import { Button } from 'react-native'
import { View, Text,StyleSheet } from 'react-native'
import { TheContextConsumer } from '../context/context'
import Charges from '../useFull/Charges'

export default function Profile({navigation}) {

    const [appartementList, setappartementList] = useState([])
    const [ChargesList, setChargesList] = useState("")

    
    
    
    useEffect(async () => {
        let x = null;
        x = await Charges(appartementList)
        
        
    }, [])

    

    return (
        <TheContextConsumer>
                {(value) => {

                    setappartementList(value.userState.proprietaireDe)
                    return(
                        <View style={styles.container}>
                            <View></View>
                            <Text>Profile</Text>
                            
                            <Text>
                                {(ChargesList) && (
                                  <Text>{JSON.stringify(ChargesList)} </Text>  
                                )}
                                
                            </Text>
                            <View>
                                <Button
                                    title="back"
                                    onPress={()=>{
                                        navigation.navigate("Dashboard")
                                    }}
                                />
                            </View>
                        </View>

                    )
                }}
        </TheContextConsumer>        
    )
}
const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'space-around',
    },
  });
